    var isLoggedIn = JSON.parse(Ecom.getCookie('session-member-record'));
    // eslint-disable-next-line no-lone-blocks
    {
        isLoggedIn!="" ? (
            <div>home</div>

        ) : (
            <Redirect to='/login' />
        )
    }
}
